import consultationImage from '../assets/consultation.jpg';
import blanchimentImage from '../assets/blachiment.jpg';
import implantsImage from '../assets/implant.jpg';
import orthodontieImage from '../assets/ortho.jpg';
import soinsGencivesImage from '../assets/gencive.jpg';
import soinsUrgenceImage from '../assets/emergency.jpg';
import prothesesImage from '../assets/prothese.jpg';
import extractionImage from '../assets/extraction.jpg';
import restaurationImage from '../assets/restoration.jpg';

const services = [
  {
    title: "Consultation Dentaire",
    description: "Des consultations complètes pour évaluer votre santé bucco-dentaire et établir un plan de traitement personnalisé.",
    image: consultationImage,
  },
  {
    title: "Blanchiment des Dents",
    description: "Offrez-vous un sourire éclatant avec nos services professionnels de blanchiment des dents.",
    image: blanchimentImage,
  },
  {
    title: "Implants Dentaires",
    description: "Remplacez vos dents manquantes avec nos implants dentaires de haute qualité pour une solution durable.",
    image: implantsImage,
  },
  {
    title: "Orthodontie",
    description: "Alignez vos dents et corrigez vos problèmes de mâchoire avec nos solutions orthodontiques modernes.",
    image: orthodontieImage,
  },
  {
    title: "Soins des Gencives",
    description: "Prévenez et traitez les maladies des gencives avec nos soins parodontaux spécialisés.",
    image: soinsGencivesImage,
  },
  {
    title: "Soins d'Urgence",
    description: "Obtenez des soins d'urgence rapides et efficaces pour vos problèmes dentaires imprévus.",
    image: soinsUrgenceImage,
  },
  {
    title: "Prothèses Dentaires",
    description: "Des prothèses dentaires de qualité pour améliorer votre confort et esthétique buccale.",
    image: prothesesImage,
  },
  {
    title: "Extraction Dentaire",
    description: "Extraction sécurisée et sans douleur pour les dents gravement endommagées.",
    image: extractionImage,
  },
  {
    title: "Restauration Dentaire",
    description: "Restaurations dentaires pour réparer et renforcer vos dents abîmées.",
    image: restaurationImage,
  },
];

export default services;
